# 392. 判断子序列
# 给定字符串 s 和 t ，判断 s 是否为 t 的子序列。
# 你可以认为 s 和 t 中仅包含英文小写字母。字符串 t 可能会很长（长度 ~= 500,000），而 s 是个短字符串（长度 <=100）。
# 字符串的一个子序列是原始字符串删除一些（也可以不删除）字符而不改变剩余字符相对位置形成的新字符串。（例如，"ace"是"abcde"的一个子序列，而"aec"不是）。

# 示例 1:
# s = "abc", t = "ahbgdc"
# 返回 true.

# 示例 2:
# s = "axc", t = "ahbgdc"
# 返回 false.

# 后续挑战 :
# 如果有大量输入的 S，称作S1, S2, ... , Sk 其中 k >= 10亿，你需要依次检查它们是否为 T 的子序列。在这种情况下，你会怎样改变代码？

# 来源：力扣（LeetCode）
# 链接：https://leetcode-cn.com/problems/is-subsequence


class Solution:
    def isSubsequence1(self, s: str, t: str) -> bool:
        """ 暴力法
        时间复杂度 O(N^2)"""
        i = 0
        result = []
        for char in s:
            for id, cur in enumerate(t[i:]):
                if char == cur:
                    i += id + 1
                    result.append(True)
                    break
        return len(result) == len(s)

    def isSubsequence2(self, s: str, t: str) -> bool:
        """ 双指针
        时间复杂度 O(N)
        """
        si, ti = 0, 0
        ls, lt = len(s), len(t)
        
        while si < ls and ti < lt:
            if s[si] == t[ti]:
                print('({}, {})'.format(si, ti))
                
                si += 1
            ti += 1

        return si == ls

    def isSubsequence3(self, s: str, t: str) -> bool:
        """ 借用迭代器 """
        t = iter(t)
        return all(i in t for i in s)

    def isSubsequence4(self, s: str, t: str) -> bool:
        if not s: return True

        i = t.find(s[0])
        if i < 0: return False

        for c in s[1:]:
            i = t.find(c, i + 1)
            if i < 0:
                return False

        return True

    def isSubsequence(self, s: str, t: str) -> bool:
        i = 0

        for c in s:
            j = t.find(c, i)
            if j == -1:
                return False
            i = j + 1

        return True


if __name__ == "__main__":
    assert Solution().isSubsequence('b', 'c') == False
    assert Solution().isSubsequence('abc', 'ahbgdc') == True
    assert Solution().isSubsequence('acb', 'ahbgdc') == False
    assert Solution().isSubsequence('bcd', '')
    assert Solution().isSubsequence("leeeeetcode", "") == False